def cekdurasi(created, exp, key):
    tahun, bulan, tanggal = exp.split('T')[0].split('-')
    opoki = datetime.datetime(int(tahun), int(bulan), int(tanggal))
    opoke = opoki.strftime('%Y-%m-%d %H:%M:%S')
    opoku = datetime.datetime.strptime(opoke, '%Y-%m-%d %H:%M:%S')
    ceku = opoku - datetime.datetime.now()
    if ceku.days < 1:
        print(f'[bold white]([bold red]√ó[bold white]) Lisensi Anda Telah Berakhir Pada : {tahun}-{bulan}-{tanggal}')
        os.remove('/sdcard/Au.txt')
        exit()
    else:  
        sisa = str(ceku).split(',')[0]
        os.system('clear')
        print('[bold white]([bold green]+[bold white]) Tunggu Sebentar')
        open('/sdcard/Au.txt', 'w').write(key)
        time.sleep(3)
        Setting().JumlahAkun(keyAuth, created.split('T')[0], sisa, key, exp.split('T')[0])

